create table chukous
(
    chukou_id   int auto_increment
        primary key,
    station_id  int          not null,
    chukou_name varchar(255) not null,
    constraint chukou_name
        unique (chukou_name),
    constraint chukous_ibfk_1
        foreign key (station_id) references stations (station_id)
);

create index station_id
    on chukous (station_id);

